INSERT INTO `indikator_news_posts` VALUES (2,'O\'zbekistonga talaba bo\'lish imkoniyati','ozbekistonga-talaba-bolish-imkoniyati','','<p><img src=\"/storage/app/media/uploaded-files/photo_2022-09-27_14-15-21.jpg\" style=\"width: 100%;\" class=\"fr-fic fr-dib\" data-result=\"success\"></p>\r\n\r\n<p>\r\n	<br>\r\n</p>','2022-09-27 04:17:22','1',57,'2022-09-27 04:17:22','2023-09-10 23:26:26','/Yangiliklar uchun/photo_2022-09-27_14-15-10.jpg',2,NULL,0,'',1,'talaba,O\'zbekiston,imkoniyat',NULL,NULL,NULL,NULL),(3,'Barcha abiturientlarga talaba bo\'lish baxti nasib etsin!','barcha-abiturientlarga-talaba-bolish-baxti-nasib-etsin','','<figure class=\"\" data-label=\"video_2022-09-27_14-15-32.mp4\" data-video=\"/storage/app/media/Yangiliklar%20uchun/video_2022-09-27_14-15-32.mp4\">&nbsp;</figure>','2022-09-27 04:19:31','1',71,'2022-09-27 04:19:25','2023-09-10 00:57:44','/Yangiliklar uchun/photo_2022-09-27_14-15-46.jpg',2,NULL,0,'',1,'abiturientlarga,talaba,bo\'lish,nasibetsin',NULL,NULL,NULL,NULL),(4,'Qabul boshlandi!','qabul-boshlandi','','<blockquote>\r\n\r\n	<p style=\"text-align: center;\">&nbsp;Hurmatli abituriyentlar Universitetimizga qabul boshlanganini e\'lon qilamiz!</p>\r\n</blockquote>\r\n\r\n<p>\r\n	<br>\r\n</p>\r\n\r\n<table style=\"width: 99%; margin-left: calc(2%); margin-right: calc(-1%);\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 100%; background-color: rgb(239, 239, 239);\">\r\n				<div style=\"text-align: center;\">\r\n					<br>\r\n				</div>\r\n				<div style=\"text-align: center;\"><strong>Kerakli hujjatlar</strong></div>\r\n\r\n				<p>\r\n					<br>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 100.0000%;\">\r\n				<br>\r\n				<div style=\"text-align: center;\">1. Rektor nomiga ariza</div>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 100.0000%;\">\r\n				<br>\r\n				<div style=\"text-align: center;\">2. Passport nusxasi</div>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 100.0000%;\">\r\n				<br>\r\n				<div style=\"text-align: center;\">3. Diplom yoki Atestat (Asl nusxasi)</div>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 100.0000%;\">\r\n				<br>\r\n				<div style=\"text-align: center;\">4. (3x4) fotosurat 10 dona</div>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 100.0000%;\">\r\n				<br>\r\n				<div style=\"text-align: center;\">5. 086 tibbiy ma\'lumotnoma</div>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<br>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','2022-09-30 02:07:29','1',80,'2022-09-30 02:05:06','2023-08-30 06:14:59','/Elonlar uchun/23423423423.jpg',2,NULL,0,'',1,'qabul,boshlandi,shoshiling',NULL,NULL,NULL,NULL),(5,'«GIPPOKRAT» NOMIDAGI TIBBIYOT TEXNIKUMI o`rta maxsus ta`lim muassasasi sifatida litsenziyaga ega bo‘ldi','toshkent-viloyatida-ilk-bor-mumtozbegim-shoxsaroyi-nodavlat-talim-tashkiloti-qoshida-mumtozbegim-sho','','<blockquote>\r\n\r\n	<p><strong>Toshkent viloyatida ilk bor «Mumtozbegim Shoxsaroyi» nodavlat ta’lim tashkiloti qoshida «Mumtozbegim Shoxsaroyi Pedagogika universiteti» va «Gippokrat» nomidagi tibbiyot texnikumi ochildi!</strong></p>\r\n</blockquote>\r\n<figure class=\"\" data-label=\"2022-12-28 20.06.43.mp4\" data-video=\"/storage/app/media/Yangiliklar%20uchun/2022-12-28%2020.06.43.mp4\">&nbsp;</figure>\r\n\r\n<p><strong>«MUMTOZBEGIM SHOXSAROYI PEDAGOGIKA UNIVERSITETI» oliy ta’lim muassasasi sifatida, «GIPPOKRAT» NOMIDAGI TIBBIYOT TEXNIKUMI o`rta maxsus ta`lim muassasasi sifatida&nbsp;</strong><strong><u>litsenziyaga</u></strong><strong>&nbsp;ega bo‘ldi va yangi o‘quv yilidan talabalar qabul qilishni boshladi. Oliygoh oliy ta’lim tizimida o‘z yo‘nalishini yaratib, innovatsion klaster ta’lim tizimi asosida zamonaviy bilimga ega yuqori malakali, professional kadrlar tayyorlash va ularni jamiyatga implemetatsiya qilishni maqsad qilgan.</strong></p>\r\n\r\n<table style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 50.0000%;\"><img src=\"/storage/app/media/uploaded-files/%D0%A1%D0%BD%D0%B8%D0%BC%D0%BE%D0%BA%20%D1%8D%D0%BA%D1%80%D0%B0%D0%BD%D0%B0%202022-12-28%20%D0%B2%2017.52.33.png\" style=\"width: 95%;\" class=\"fr-fic fr-dib\" data-result=\"success\"></td>\r\n			<td style=\"width: 50.0000%;\"><img src=\"/storage/app/media/uploaded-files/%D0%A1%D0%BD%D0%B8%D0%BC%D0%BE%D0%BA%20%D1%8D%D0%BA%D1%80%D0%B0%D0%BD%D0%B0%202022-12-28%20%D0%B2%2017.52.58.png\" style=\"width: 85%;\" class=\"fr-fic fr-dib\" data-result=\"success\"></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Yangi oliy ta’lim muassasasida talabalar quyidagi:</strong></p>\r\n\r\n<p>boshlang‘ich ta’lim;</p>\r\n\r\n<p>maktabgacha ta’lim;</p>\r\n\r\n<p>defektologiya</p>\r\n\r\n<p>pedagogika va psixologiya kabi 4ta yo‘nalishlarda kunduzgi va sirtqi ta’lim shakllarida tahsil olishlari mumkin.</p>\r\n\r\n<ul>\r\n	<li><strong>hamshiralik ishi</strong></li>\r\n	<li><strong>feldsher-akusherlik ishi&nbsp;</strong>kabi 2ta yo‘nalishlarda kunduzgi ta’lim shakllarida tahsil olishlari mumkin.</li>\r\n</ul>\r\n\r\n<p><strong>Qabul jarayonlari 2022 yilning 15 avgustidan 30 dekabrga qadar davom etadi.</strong></p>\r\n\r\n<p>Shoshiling. <strong>Universitet va texnikum</strong> o‘z talabalarini kutmoqda!</p>\r\n\r\n<p><strong>Qo‘shimcha ma’lumot uchun:</strong></p>\r\n\r\n<p>+998946659727</p>\r\n\r\n<p>+998978819727<u>&nbsp;</u></p>\r\n\r\n<p>Universitet veb sayti: <a href=\"https://alfraganusuniversity.uz/\" target=\"_blank\">mumtozbegimshoxsaroyi.uz</a></p>\r\n\r\n<p><strong>Manzil:</strong> Toshkent viloyati Yangiyo`l shahri Farovon MFY O`zbekiston ko`chasi Yangi farovon dahasi 1-uy</p>','2022-12-28 07:54:12','1',75,'2022-12-28 07:54:07','2023-09-14 15:34:18','/Elonlar uchun/mumtozbegim-shohsaroy-klaster-2-2-pdfio-1-2-min.jpg',1,NULL,0,'',1,'universitet mumtozbegim shoxsaroyi',NULL,NULL,NULL,NULL);
